import './App.css';
import { getSuggestions } from './mock-server'

class App extends Component{
  constructor() {
    super();
    this.state = {
      suggestions: [],
    }
  }

  handleClick() {
    let value = document.getElementById('searchBox').value;
    getSuggestions(value).then(suggestions => suggestions);
