  }

  render() {
    const showSuggestions =  <ul>
          {this.state.suggestions.map(item => <li> item </li>)}
      </ul>

    return (
      <div className="app">
       <input id="searchBox" onKeyDown={this.handleClick}></input>
       {showSuggestions}
      </div>
    );
  }
}
export default App;
